import React from 'react';
import { Link } from 'react-router-dom';
import './components.css';

interface Whisky {
  id: string;
  name: string;
  image: string;
  origin: string;
  distiller: string;
  type: string;
  flavour: string;
}

interface WhiskyCardProps {
  whisky: Whisky;
}

const WhiskyCard: React.FC<WhiskyCardProps> = ({ whisky }) => {
  return (
    <div className="whisky-card">
      <div className="whisky-card-image">
        <img src={whisky.image} alt={whisky.name} />
      </div>
      <div className="whisky-card-content">
        <h3>{whisky.name}</h3>
        <p><strong>Origin:</strong> {whisky.origin}</p>
        <p><strong>Distiller:</strong> {whisky.distiller}</p>
        <p><strong>Type:</strong> {whisky.type}</p>
        <Link to={`/whisky/${whisky.id}`} className="whisky-card-link">자세히 보기</Link>
      </div>
    </div>
  );
};

export default WhiskyCard;
